import React from "react";
import TeamMember from "./TeamMember";

function Team () {
    return(
        <div className="row">
            <TeamMember 
                info={
                    {
                        img:'/images/AhouziYoussef.jpg',
                        name:'Ahouzi Youssef', 
                        position:'CEO at PortNet',
                        phone:'+212 12345678' ,
                        email:'Ahouzi@PortNet.com',
                        website:'AhouziPortNet.com',
                    }
            }/>
            <TeamMember 
                info={
                    {
                        img:'/images/MehdiELMUILHI.jpg',
                        name:'Mehdi EL MUILHI', 
                        position:'Chief Financial and Administrative Officer',
                        phone:'+212 12345678' ,
                        email:'Mulhi@PortNet.com',
                        website:'MulhiPortNet.com',
                    }
            }/>

            <TeamMember 
                info={
                    {
                        img:'/images/MehdiTazi.jpg',
                        name:'Mehdi Tazi', 
                        position:'Project Manager',
                        phone:'+212 12345678' ,
                        email:'Tazi@PortNet.com',
                        website:'TaziPortNet.com',
                    }
                }/>

            <TeamMember 
                info={
                    {
                        img:'/images/NabilOuzire.jpg',
                        name:'Nabil ouzire', 
                        position:'Project Manager',
                        phone:'+212 12345678' ,
                        email:'ouzire@PortNet.com',
                        website:'ouzirePortNet.com',
                    }
                }/>

            <TeamMember 
                info={
                    {
                        img:'/images/SaidAITBENALI.jpg',
                        name:'Said AIT BEN ALI', 
                        position:'Senior Java JEE Developer',
                        phone:'+212 12345678' ,
                        email:'AitBenAli@PortNet.com',
                        website:'AitBenAliPortNet.com',
                    }
                }/>

            <TeamMember 
                info={
                    {
                        img:'/images/RymeBensbih.jpg',
                        name:'Ryme Bensbih', 
                        position:'Communication and Change Management Manager',
                        phone:'+212 12345678' ,
                        email:'Bensbih@PortNet.com',
                        website:'BensbihPortNet.com',
                    }
                }/>
        </div>
    )
}

export default Team;
